import "./App.css";
import Footer from "./component/Footer";
import Header from "./component/Header";
import Home from "./pages/Home";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>

            <Header />
            <Route path="/" element={<Home />}></Route>

        </Routes>
      </Router>
      <Footer />
    </div>
  );
}

export default App;
